import React from "react";
import '../Components/Navbar.css'

export default function Navbar() {

    const modeToggle = document.getElementById("mode-toggle");
    const navbar = document.querySelector(".navbar");
    const body = document.body;

    // Set dark mode as the default state
    modeToggle.checked = true;
    navbar.classList.add("dark-mode");
    body.classList.add("dark-mode");

    modeToggle.addEventListener("change", function () {
        if (modeToggle.checked) {
            navbar.classList.add("dark-mode");
            body.classList.add("dark-mode");
        } else {
            navbar.classList.remove("dark-mode");
            body.classList.remove("dark-mode");
        }
    });

    return(
        <div className="navbar">
            <h1 className="nav-title">Brett Wallin</h1>
            <h4 className="nav-contents">About Me</h4>
            <h4 className="nav-contents">Projects</h4>
            <h4 className="nav-contents">Resume</h4>
            <h4 className="nav-contents">Contact Me</h4>
            <input type="checkbox" id="mode-toggle" />
            <label for="mode-toggle">Change Dark Mode</label>
            <label for="mode-toggle" className="mode-toggle-label"></label>
        </div>
    )
}
